module hj.library.components.modal {
	export var ErrorDialogComponentView:string = "\u003cdiv class=\"dialog-overlay-layer\"\u003e\r\n    \u003c!-- Note the css binding, since class name contains \u0027-\u0027, so need to quote the class name --\u003e\r\n    \u003cdiv class=\"dialog-container\" data-bind=\"css: {\u0027dialog-maximized\u0027: _maxmized}\"\u003e\r\n        \u003cdiv class=\"error-dialog-header\"\u003e\r\n            \u003cspan class=\"dialog-title\"\u003e\u003ci class=\"fa fa-warning\"\u003e\u003c/i\u003e\u003c/span\u003e\r\n            \u003cspan class=\"dialog-title\" data-bind=\"text: _title\"\u003e\u003c/span\u003e\r\n        \u003c/div\u003e\r\n\r\n        \u003cdiv class=\"error-dialog-content\"\u003e\r\n            \u003c!-- tab pages --\u003e\r\n            \u003c!-- Make the first tab header and tab content be active --\u003e\r\n            \u003cul class=\"nav nav-tabs\" data-bind=\"foreach: _messages\"\u003e\r\n                \u003cli data-bind=\"css: {active: ($index() === 0)}\"\u003e\u003ca data-toggle=\"tab\" data-bind=\"attr: {href: \u0027#\u0027 + title.replace(\u0027 \u0027, \u0027-\u0027) }, text: title, css: {active: ($index() === 0)}\"\u003e\u003c/a\u003e\u003c/li\u003e\r\n            \u003c/ul\u003e\r\n            \u003cdiv class=\"tab-content\" data-bind=\"foreach: _messages\"\u003e\r\n                \u003cdiv class=\"tab-pane\" data-bind=\"attr: {id: title.replace(\u0027 \u0027, \u0027-\u0027)}, text: message, css: {active: ($index() === 0)}\"\u003e\u003c/div\u003e\r\n            \u003c/div\u003e\r\n        \u003c/div\u003e\r\n\r\n        \u003cdiv class=\"dialog-footer\"\u003e\r\n            \u003cbutton class=\"btn btn-default\" data-bind=\"text: _dismissButtonText, click: dismissClick\"\u003e\u003c/button\u003e\r\n            \u003cbutton class=\"btn btn-default\" data-bind=\"text: _maximizeButtonText, click: maxClick, visible: !_maxmized()\"\u003e\u003c/button\u003e\r\n            \u003cbutton class=\"btn btn-default\" data-bind=\"text: _restoreButtonText, click: maxClick, visible: _maxmized\"\u003e\u003c/button\u003e\r\n        \u003c/div\u003e\r\n    \u003c/div\u003e\r\n\u003c/div\u003e\r\n";
	export var ErrorDialogComponentViewId:string = "hj-library-components-modal-ErrorDialogComponentView";
	export var HTMLDialogComponentView:string = "\u003cdiv class=\"dialog-overlay-layer\"\u003e\r\n    \u003c!-- ** Here used the hj-set-scoped-context to extend the binding context to make the component\u0027s markup (which represented by $componentTemplateNodes) accessable for all child elements --\u003e\r\n    \u003c!-- because we need to get the markup in the dialog content segment --\u003e\r\n    \u003cdiv class=\"dialog-container\" data-bind=\"css: {\u0027dialog-maximized\u0027: _maximized}, \u0027hj-set-scoped-context\u0027: {$$dialogNodes: $componentTemplateNodes}\"\u003e\r\n        \u003chj-flex-container\u003e\r\n            \u003chj-flex-shrink\u003e\r\n                \u003cdiv class=\"dialog-header\"\u003e\r\n                    \u003cspan class=\"dialog-title\" data-bind=\"text: _title\"\u003e\u003c/span\u003e\r\n                \u003c/div\u003e\r\n            \u003c/hj-flex-shrink\u003e\r\n            \u003chj-flex-grow\u003e\r\n                \u003chj-flex-scroll\u003e\r\n                    \u003cdiv class=\"dialog-content\"\u003e\r\n                        \u003c!-- Explicit HTML content, like the ... between \u003chj-html-dialog\u003e...\u003c/hj-html-dialog\u003e --\u003e\r\n                        \u003c!-- ** Here we get the markup by the field $$dialogNodes which is the extended content of the binding context. --\u003e\r\n                        \u003c!-- We couldn\u0027t use the $componentTemplateNode here directly because it will cause circle reference and cause infinite loop,\r\n                             this might becasue the hj-felx-scroll container is also implemented by using the $componentTemplateNode, so have to use the \r\n                             hj-set-scoped-context bindng here to avoid the infinite loop  --\u003e\r\n\r\n                        \u003c!-- ko if: $$dialogNodes \u0026\u0026 $$dialogNodes.length \u003e 0 --\u003e\r\n                        \u003c!-- ko template: { nodes: $$dialogNodes, data: _data} --\u003e\u003c!-- /ko --\u003e\r\n                        \u003c!-- /ko --\u003e\r\n\r\n\r\n                        \u003c!-- Template view content --\u003e\r\n                        \u003c!-- ko if: _templateName --\u003e\r\n                        \u003c!-- ko template: {name: _templateName, data: _data } --\u003e\u003c!--/ko --\u003e\r\n                        \u003c!-- /ko --\u003e\r\n                    \u003c/div\u003e\r\n                \u003c/hj-flex-scroll\u003e\r\n            \u003c/hj-flex-grow\u003e\r\n            \u003chj-flex-shrink\u003e\r\n                \u003cdiv class=\"dialog-footer\"\u003e\r\n                    \u003c!-- ko if: _isDismissButtonVisible --\u003e\r\n                    \u003cbutton class=\"btn btn-default\" data-bind=\"text:_dismissButtonText, click: dismissClick, hasFocus: _isDismissButtonFocused\"\u003e\u003c/button\u003e\r\n                    \u003c!-- /ko --\u003e\r\n                    \u003c!-- ko if: _isMaximizeButtonVisible --\u003e\r\n                    \u003cbutton class=\"btn btn-default\" data-bind=\"text:_maximizeButtonText, click: maxClick, visible:!_maximized()\"\u003e\u003c/button\u003e\r\n                    \u003cbutton class=\"btn btn-default\" data-bind=\"text:_restoreButtonText, click: maxClick, visible:_maximized\"\u003e\u003c/button\u003e\r\n                    \u003c!-- /ko --\u003e\r\n                    \u003c!-- ko foreach: _customButtons --\u003e\r\n                    \u003cbutton class=\"btn btn-default\" data-bind=\"text: $data.text, click: $data.click, visible: $data.visible, hasFocus: $data.hasFocus, enable: $data.enable\"\u003e\u003c/button\u003e\r\n                    \u003c!-- /ko --\u003e\r\n                \u003c/div\u003e\r\n            \u003c/hj-flex-shrink\u003e\r\n        \u003c/hj-flex-container\u003e\r\n    \u003c/div\u003e\r\n\u003c/div\u003e";
	export var HTMLDialogComponentViewId:string = "hj-library-components-modal-HTMLDialogComponentView";
	export var InformationDialogComponentView:string = "\u003cdiv class=\"dialog-overlay-layer\"\u003e\r\n    \u003cdiv class=\"dialog-container\"\u003e\r\n        \u003cdiv class=\"dialog-header\"\u003e\r\n            \u003cspan class=\"dialog-title\" data-bind=\"text: _title\"\u003e\u003c/span\u003e\r\n        \u003c/div\u003e\r\n        \u003cdiv class=\"dialog-content\"\u003e\r\n            \u003cspan class=\"dialog-message-header\" data-bind=\"text: _header\"\u003e\u003c/span\u003e\r\n            \u003cdiv class=\"dialog-message\" data-bind=\"text: _message\"\u003e\u003c/div\u003e\r\n        \u003c/div\u003e\r\n        \u003cdiv class=\"dialog-footer\"\u003e\r\n            \u003c!-- ko if: _isOKButtonVisible --\u003e\r\n            \u003cbutton class=\"btn btn-default\" data-bind=\"text: _okButtonText, click: confirmClick\"\u003e\u003c/button\u003e\r\n            \u003c!-- /ko --\u003e\r\n            \u003c!-- ko if: _isCancelButtonVisible --\u003e\r\n            \u003cbutton class=\"btn btn-default\" data-bind=\"text: _cancelButtonText, click: cancelClick\"\u003e\u003c/button\u003e\r\n            \u003c!-- /ko --\u003e\r\n        \u003c/div\u003e\r\n    \u003c/div\u003e\r\n\u003c/div\u003e\r\n";
	export var InformationDialogComponentViewId:string = "hj-library-components-modal-InformationDialogComponentView";
}
