	export var MenuItemTemplateView:string = "\u003ca href=\"#\" class=\"link-container\" data-bind=\"click: click, indent: $data\"\u003e\r\n    \u003cspan data-bind=\"text: text\"\u003e\u003c/span\u003e\r\n    \u003c!-- ko ifnot: hasChildren --\u003e\r\n    \u003ci class=\"fa fa-external-link space-icon\" data-bind=\"click: clickNewSpaceIcon\"\u003e\u003c/i\u003e\r\n    \u003c!-- /ko --\u003e\r\n\r\n    \u003c!-- ko if: hasChildren --\u003e\r\n    \u003c!-- ko ifnot: isExpanded --\u003e\r\n    \u003ci class=\"fa fa-angle-right arrow\"\u003e\u003c/i\u003e\r\n    \u003c!-- /ko --\u003e\r\n\r\n    \u003c!-- ko if: isExpanded --\u003e\r\n    \u003ci class=\"fa fa-angle-down arrow\"\u003e\u003c/i\u003e\r\n    \u003c!-- /ko --\u003e\r\n    \u003c!-- /ko --\u003e\r\n\u003c/a\u003e\r\n\r\n\u003c!-- ko if: hasChildren --\u003e\r\n\u003c!-- ko if: isExpanded --\u003e\r\n\u003cul class=\"nav nav-pills nav-stacked\" data-bind=\"foreach: subMenus\"\u003e\r\n    \u003cli data-bind=\"template: \u0027hj-library-menu-MenuItemTemplateView\u0027, menuItemState: $data\"\u003e\u003c/li\u003e\r\n\u003c/ul\u003e\r\n\u003c!-- /ko --\u003e\r\n\u003c!-- /ko --\u003e\r\n";
	export var MenuItemTemplateViewId:string = "hj-library-menu-MenuItemTemplateView";
	export var NavigationMenuView:string = "\u003cdiv class=\"fs-nav\"\u003e\r\n    \u003cnav class=\"quick-nav\"\u003e\r\n        \u003cul class=\"nav nav-pills nav-stacked\"\u003e\r\n            \u003cli class=\"active\"\u003e\u003ca href=\"#menuBar\" data-toggle=\"tab\"\u003e\u003ci class=\"fa fa-bars fa-fw\"\u003e\u003c/i\u003e\u003c/a\u003e\u003c/li\u003e\r\n            \u003cli\u003e\u003ca href=\"#spaceBar\" data-toggle=\"tab\"\u003e\u003ci class=\"fa fa-th saved fa-fw\"\u003e\u003c/i\u003e\u003c/a\u003e\u003c/li\u003e\r\n        \u003c/ul\u003e\r\n    \u003c/nav\u003e\r\n    \u003cdiv class=\"tab-content\"\u003e\r\n        \u003cnav id=\"menuBar\" class=\"app-navigation-bar tab-pane fade in active\"\u003e\r\n            \u003c!-- custome binding handler menuState is used to update menu style at runtime --\u003e\r\n            \u003cul class=\"nav nav-pills nav-stacked\" data-bind=\"foreach: navigationMenus\"\u003e\r\n                \u003cli data-bind=\"css: {\u0027active\u0027: isActive}, template: \u0027hj-library-menu-MenuItemTemplateView\u0027, menuItemState: $data\"\u003e\u003c/li\u003e\r\n            \u003c/ul\u003e\r\n        \u003c/nav\u003e\r\n        \u003cnav id=\"spaceBar\" class=\"app-navigation-bar tab-pane fade\"\u003e\r\n            \u003cul class=\"nav nav-pills nav-stacked\" data-bind=\"foreach: spaceList.spaces\"\u003e\r\n                \u003cli data-bind=\"css: {\u0027active\u0027: isActive}, menuItemState: $data\"\u003e\r\n                    \u003ca href=\"#\" class=\"link-container\" data-bind=\"click: hj.library.Application.instance.spaceList.open\"\u003e\r\n                        \u003cspan data-bind=\"text: title\"\u003e\u003c/span\u003e\r\n                        \u003ci class=\"fa fa-close close-icon\" data-bind=\"visible: canClose, click: $parent.closeSpace\"\u003e\u003c/i\u003e\r\n                    \u003c/a\u003e\r\n                \u003c/li\u003e\r\n            \u003c/ul\u003e\r\n        \u003c/nav\u003e\r\n    \u003c/div\u003e\r\n\u003c/div\u003e";
	export var NavigationMenuViewId:string = "hj-library-menu-NavigationMenuView";
